A solution of 10% Pd/C (0.028 mmol) was added to a solution of 6 (0.140 mmol) in EtOAc (10 mL) while stirring, and the reaction mixture was further stirred overnight at 40 °C under a H 2 atmosphere. The solid was filtered off and the filtrate was concentrated under a vacuum. The residue was redissolved in hexane and purified by silica gel column chromatography using hexane/EtOAc (4:1) as an eluent, resulting in compound 7 (yield 74%) as a white solid. Its structure was confirmed by 1H- and 13C-NMR and ESI-MS and compared with previous results [ 18]. 1H NMR (500 MHz, CDCl 3) δ 11.78 (1H, s), 6.14 (1H, s), 2.63 (1H, dd, J = 16.8 Hz), 2.44 (3H, s), 2.19–2.25 (m, 1H), 2.01 (1H, dt, 3.1, 13.0 Hz), 1.69 (2H, m), 1.54–1.60 (3H, m), 1.48 (1H, dd, J = 5.4, 13.0 Hz), 1.38–1.43 (1H, m), 1.28–1.35 (2H, m), 1.13 (3H, s), 0.96 (1H, dd, J = 2.2, 12.4 Hz), 0.90 (1H, dd, J = 3.2, 13.0 Hz), 0.85 (3H, s), 0.83 (3H, s), 0.78 (3H, s) [α
